INSERT INTO `pets` (`id`, `type`, `pet_name`, `description`, `pet_image`, `image_type`, `pet_age`, `pet_breed`, `pet_gender`, `pet_kind`, `pet_vacinated`) VALUES
(5, 'Cat', 'Tabasco', 'Tabasco was the first of the three kittens spotted near our foster’s home, hiding under a parked tricycle with eyes wide and body tense. She was covered in dirt and let out tiny growls when approached, warning everyone to stay away. With slow, careful steps and food as bait, our foster was able to gently lure her out. It took time and a lot of patience, but Tabasco finally allowed herself to be scooped up—and that marked the beginning of her second chance at life.', , 'image/jpeg', '3-4 months', 'Very playful and loves food', '4-1 x2', 'Puspin, half tabby', 'Female');
INSERT INTO `pets` (`id`, `type`, `pet_name`, `description`, `pet_image`, `image_type`, `pet_age`, `pet_breed`, `pet_gender`, `pet_kind`, `pet_vacinated`) VALUES
(6, 'Cat', 'Cayenne', 'Cayenne was found just a few feet away from Tabasco, crouched inside an old cardboard box near a neighbor’s gate. She was alert, fierce, and clearly trying to protect herself and her sisters. While she put up a little fight, she also seemed the most curious about the humans trying to help. She eventually allowed herself to be carried, eyes never leaving her sisters. Cayenne showed early signs of leadership—brave, protective, and strong—and continues to carry that spirit in her foster home.', , 'image/jpeg', '3-4 months', 'Very playful and loves food', '4-1 x2', 'Puspin, Calico', 'Female');
INSERT INTO `pets` (`id`, `type`, `pet_name`, `description`, `pet_image`, `image_type`, `pet_age`, `pet_breed`, `pet_gender`, `pet_kind`, `pet_vacinated`) VALUES
(7, 'Cat', 'Jalapeño', 'Jalapeño was the last one rescued—and the most fearful. She had taken shelter behind a pile of wood, trembling at every sound. Her eyes were filled with fear, and it was clear she had not experienced kindness before. It took several quiet visits, gentle coaxing, and the sound of her sisters meowing nearby before she dared to come out. When she was finally brought into safety, she clung quietly to her siblings, drawing comfort from their presence. She’s since made huge strides and is now blooming into a gentle, loving kitten.', , 'image/jpeg', '3-4 months', 'Very playful and loves food', '4-1 x2', 'Puspin, Full tabby', 'Female');
INSERT INTO `pets` (`id`, `type`, `pet_name`, `description`, `pet_image`, `image_type`, `pet_age`, `pet_breed`, `pet_gender`, `pet_kind`, `pet_vacinated`) VALUES
(8, 'Dog', 'Miky', 'Milky is a playful male pup around 3–4 months old, rescued from a neglectful past. Now healthy and fully vaccinated with 5-in-1, he\'s thriving in foster care. Milky loves boiled chicken, puppy milk, and playtime—and is looking for a forever home filled with love and patience.', , 'image/jpeg', '4-5 months', 'Very playful and loves food', '4-1 x2', 'Aspin (dirty white fur)', 'Male');
INSERT INTO `pets` (`id`, `type`, `pet_name`, `description`, `pet_image`, `image_type`, `pet_age`, `pet_breed`, `pet_gender`, `pet_kind`, `pet_vacinated`) VALUES
(9, 'Dog', 'Hany', 'Hany was rescued from the streets, underweight and neglected. Despite his rough start, he quickly bounced back with proper care and love.', , 'image/jpeg', '4-5 months', 'Very playful and loves food', '5- in-1 x2', 'Aspin brown * white fur', 'Male');
INSERT INTO `pets` (`id`, `type`, `pet_name`, `description`, `pet_image`, `image_type`, `pet_age`, `pet_breed`, `pet_gender`, `pet_kind`, `pet_vacinated`) VALUES
(10, 'Dog', 'Belle', 'Belle was found as a tiny stray, wandering alone—likely separated from her mother far too early. Weak and vulnerable, she was taken in by Shelter of Light where she finally received the warmth and safety every pup deserves.', , 'image/jpeg', '3-4 months', 'Very playful and loves food', '5- in-1 x2, Dewormed', 'Aspin, small breed', 'Female');
INSERT INTO `pets` (`id`, `type`, `pet_name`, `description`, `pet_image`, `image_type`, `pet_age`, `pet_breed`, `pet_gender`, `pet_kind`, `pet_vacinated`) VALUES
(11, 'Dog', 'Snoopy', 'Snoopy is one of Akira’s pups who was neglected by previous owners and later surrendered when he got sick. Diagnosed with parvo, he is now under care and fighting through with strength and resilience. He’ll be moving to a loving foster home this week.', , 'image/jpeg', '6-7 months', '5-1 x2', 'Very playful and swe', 'Aspin (white, bigger)', 'Male');
INSERT INTO `pets` (`id`, `type`, `pet_name`, `description`, `pet_image`, `image_type`, `pet_age`, `pet_breed`, `pet_gender`, `pet_kind`, `pet_vacinated`) VALUES
(12, 'Dog', 'Tofu', 'Surrendered by previous owners after neglect and lack of medical care. They only gave him up when he became seriously ill. Tofu is now under the care of Shelter of Light with the help of Lala\'s Haven. Very playful and sweet.', , 'image/jpeg', '6-7 months', 'Very playful and swee', '5-1 x2', 'Aspin (white, smaller)', 'Male');

